      <p class="main-text">لتأكيد حسابك والبدء ببناء ملفك الشخصي،<br>يرجى تأكيد بريدك الإلكتروني عبر الضغط على الزر أدناه.</p>
      <p class="secondary-text">بمجرد تأكيد حسابك، يمكنك البدء باستخدام المنصة، وتصميم وإطلاق تدريباتك الخاصة بكل سهولة.</p>
      
